Ingredients:
for 1 serving

• 1 🥭 mango 
• 1 tablespoon sugar
• 1 cup milk 🥛 
• 1 cup plain yogurt 

Preparation:

1️⃣ Cut the mango in half lengthwise, around the pit.
2️⃣ Press the mango halves down along the edge of glass to separate the flesh from the skin.
3️⃣ Add the mango to a blender, along with the sugar, milk, and yogurt. 
4️⃣ Blend until smooth.
5️⃣ Pour the mango lassi into a glass.
6️⃣ Enjoy!

